import React from "react";
import { Container, Grid, Toolbar } from "@mui/material";
import logo from "../../Logo.svg";

const LayoutAppBar = () => {
  return (
    <Container>
      <AppBar>
        <Toolbar>
          <Grid item>
            <img src={logo} />
          </Grid>
        </Toolbar>
      </AppBar>
    </Container>
  );
};

export default LayoutAppBar;
